WHERE FK_Reference_SnomedCT_ID IN (SELECT FK_Reference_SnomedCT_ID FROM #VersionedSnomedSets WHERE Concept = 'height' AND Version = 1)
AND [Value] IS NOT NULL
AND [Value] >= 0.01
