IF OBJECT_ID('tempdb..#PatientHeightInMetrestemp3') IS NOT NULL DROP TABLE #PatientHeightInMetrestemp3;
SELECT 
  CASE WHEN t1.FK_Patient_Link_ID IS NULL THEN t2.FK_Patient_Link_ID ELSE t1.FK_Patient_Link_ID END AS FK_Patient_Link_ID,
	CASE
		WHEN t1.MostRecentDate IS NULL THEN t2.MostRecentDate
		WHEN t2.MostRecentDate IS NULL THEN t1.MostRecentDate
		WHEN t1.MostRecentDate < t2.MostRecentDate THEN t2.MostRecentDate
		ELSE t1.MostRecentDate
	END AS MostRecentDate
INTO #PatientHeightInMetrestemp3
FROM #PatientHeightInMetrestemp1 t1	
FULL JOIN #PatientHeightInMetrestemp2 t2 on t1.FK_Patient_Link_ID = t2.FK_Patient_Link_ID;

IF OBJECT_ID('tempdb..#PatientHeightInMetres') IS NOT NULL DROP TABLE #PatientHeightInMetres;
SELECT
  t3.FK_Patient_Link_ID,
  MAX(t3.MostRecentDate) AS MostRecentDate,
  MAX([Value]) AS MostRecentValue
INTO #PatientHeightInMetres
FROM #PatientHeightInMetrestemp3 t3
